import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import styled from 'styled-components';
import { ButtonContainer } from './Button'
import { NavWrapper } from './Navbar'
import logo from '../brand.png';

export default class Navbar extends Component {
    render() {
        return(

            //Navbar
            <NavWrapper className="navbar navbar-expand-sm navbar-dark px-sm-5">
                <Link to='/'>
                    <img src={logo} alt="Adidas" className="navbar-brand" />
                </Link>
                
                
                <ul className="navbar-nav align-items-center">
                    <li className="nav-item ml-5"><Link to="/" className="nav-link text-dark bg-warning">Produtos</Link></li>
                    <li className="nav-item"><Link to="/" className="nav-link">Sobre</Link></li>
                    <li className="nav-item"><Link to="/" className="nav-link">Contato</Link></li>
                    <li className="nav-item"><Link to="/" className="nav-link">Cadastro</Link></li>
                </ul>

                <Link to='/cart' className="ml-auto">
                    <ButtonContainer>
                        <span><i class="fas fa-shopping-cart" title="Meu carrinho" alt="Carrinho" /></span>
                    </ButtonContainer>
                </Link>
            </NavWrapper>
        ); 
    }
}
